import React, { useRef } from 'react';
import { FiSearch } from 'react-icons/fi';
import { Column } from 'react-table';

import Header from '@/components/Header';
import Select from '@/components/Select';
import SEO from '@/components/SEO';
import Sidebar from '@/components/Sidebar';
import Table from '@/components/Table';
import Title from '@/components/Title';
import { Button, Flex, Text, Tooltip } from '@chakra-ui/core';
import { FormHandles } from '@unform/core';
import { Form } from '@unform/web';

interface IFormData {
  email: string;
  password: string;
}

const GENERAL = [
  {
    Header: <Text color="#4169e1">% Físico acumulado previsto</Text>,
    accessor: 'estimated_cumultative_physics',
  },
  {
    Header: <Text color="#f33">% Físico Acumulado Executado</Text>,
    accessor: 'cumulative_physics_executed',
  },
  {
    Header: <Text color="#4169e1">% Físico Mensal Previsto</Text>,
    accessor: 'expected_monthly_physical',
  },
  {
    Header: <Text color="#f33">% Físico Mensal Executado</Text>,
    accessor: 'physical_monthly_executed',
  },
  {
    Header: 'Desvio físico',
    accessor: 'physical_deviation',
  },
  {
    Header: <Text color="green.400">Obra adiantada (em dias)</Text>,
    accessor: 'performed_monthly_physicist',
  },
] as Column[];

const SUMMARY_OF_ACTIVITIES = [
  {
    Header: <Text color="#f33">Item</Text>,
    accessor: 'item',
  },
  {
    Header: <Text color="#f33">Atividades Atrasadas</Text>,
    accessor: 'late_activities',
  },
  {
    Header: <Text color="#f33">% Prev. Até a data</Text>,
    accessor: 'prev',
  },
  {
    Header: <Text color="#f33">% Real. Até a data</Text>,
    accessor: 'real',
  },
] as Column[];

const Dashboad: React.FC = () => {
  const formRef = useRef<FormHandles>(null);
  return (
    <>
      <SEO
        title="Lafe"
        image="og/boost.png"
        shouldExcludeTitleSuffix
        description="Fazer Dashboad na plataforma"
      />

      <Flex
        as="main"
        height="100vh"
        direction="column"
        backgroundColor="blue.500"
      >
        <Header />
        <Flex height="100%">
          <Sidebar />
          <Flex
            paddingX={6}
            paddingY={2}
            width="100%"
            direction="column"
            height="100%"
          >
            <Flex color="gray.800" direction="column" width="100%">
              <Title>Filtros</Title>
              <Form
                css={{
                  width: '35%',
                  display: 'flex',
                  alignItems: 'center',
                  flexDirection: 'row',
                }}
                ref={formRef}
                onSubmit={() => {}}
              >
                <Select
                  height={8}
                  backgroundColor="White"
                  name="construction"
                  placeholder="Selecione a obra"
                  containerProps={{
                    border: '1px solid',
                    height: 10,
                    borderColor: 'gray.400',
                    bg: 'white',
                  }}
                >
                  <option value="Obra1">Obra1</option>
                  <option value="Obra2">Obra2</option>
                  <option value="Obra3">Obra3</option>
                </Select>
                <Select
                  height={8}
                  backgroundColor="White"
                  name="month"
                  placeholder="Selecione o mês"
                  containerProps={{
                    height: 10,
                    marginLeft: '16px',
                    border: '1px solid',
                    borderColor: 'gray.400',
                    bg: 'white',
                  }}
                >
                  <option value="Mês1">Mês1</option>
                  <option value="Mês2">Mês2</option>
                  <option value="Mês3">Mês3</option>
                </Select>
                <Tooltip
                  label="Pesquisar velórios por cemitério"
                  aria-label="Pesquisar velórios por cemitério"
                >
                  <Button marginLeft={4} height={10} type="submit">
                    <FiSearch size={40} />
                  </Button>
                </Tooltip>
              </Form>
            </Flex>
            <Flex direction="column" marginTop={4} width="50%">
              <Table
                data={[
                  {
                    estimated_cumultative_physics: '05',
                    cumulative_physics_executed: 'FUNDAÇÃO',
                    expected_monthly_physical: '32,20%',
                    physical_monthly_executed: '17,17%',
                    physical_deviation: '17,17%',
                    performed_monthly_physicist: '17,17%',
                  },
                ]}
                columns={GENERAL}
              />
            </Flex>
            <Table
              title="Principais Atividades Resumo"
              data={[
                {
                  item: '05',
                  late_activities: 'FUNDAÇÃO',
                  prev: '32,20%',
                  real: '17,17%',
                },
              ]}
              columns={SUMMARY_OF_ACTIVITIES}
            />
          </Flex>
        </Flex>
      </Flex>
    </>
  );
};

export default Dashboad;
